import React from 'react';
import {
  Grid,
  TextField,
  Typography,
  Paper,
  Slider,
  FormControlLabel,
  Switch,
  Box,
  InputAdornment,
} from '@mui/material';

const PhysicalAttributesTab = ({ formik }) => {
  return (
    <Paper elevation={0} sx={{ p: 3 }}>
      <Typography variant="h6" gutterBottom>
        Physical Attributes
      </Typography>
      <Grid container spacing={3}>
        {/* Range slider for Effective Age */}
        <Grid item xs={12}>
          <Typography id="effective-age-slider" gutterBottom>
            Effective Age: {formik.values.effectiveAge || 1} years
          </Typography>
          <Slider
            aria-labelledby="effective-age-slider"
            id="effectiveAge"
            name="effectiveAge"
            value={formik.values.effectiveAge || 1}
            onChange={(_, newValue) => {
              formik.setFieldValue('effectiveAge', newValue);
            }}
            onBlur={formik.handleBlur}
            valueLabelDisplay="auto"
            step={1}
            marks
            min={1}
            max={50}
            sx={{ mt: 1 }}
          />
          {formik.touched.effectiveAge && formik.errors.effectiveAge && (
            <Typography color="error" variant="caption">
              {formik.errors.effectiveAge}
            </Typography>
          )}
        </Grid>

        {/* Measurement inputs for Floor Plate/Ceiling Height */}
        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            id="floorPlateArea"
            name="floorPlateArea"
            label="Floor Plate Area"
            type="number"
            value={formik.values.floorPlateArea}
            onChange={formik.handleChange}
            onBlur={formik.handleBlur}
            error={formik.touched.floorPlateArea && Boolean(formik.errors.floorPlateArea)}
            helperText={formik.touched.floorPlateArea && formik.errors.floorPlateArea}
            InputProps={{
              endAdornment: <InputAdornment position="end">sq ft</InputAdornment>,
              inputProps: { min: 0 }
            }}
          />
        </Grid>

        <Grid item xs={12} sm={6}>
          <TextField
            fullWidth
            id="ceilingHeight"
            name="ceilingHeight"
            label="Ceiling Height"
            type="number"
            value={formik.values.ceilingHeight}
            onChange={formik.handleChange}
            onBlur={formik.handleBlur}
            error={formik.touched.ceilingHeight && Boolean(formik.errors.ceilingHeight)}
            helperText={formik.touched.ceilingHeight && formik.errors.ceilingHeight}
            InputProps={{
              endAdornment: <InputAdornment position="end">ft</InputAdornment>,
              inputProps: { min: 0, step: 0.1 }
            }}
          />
        </Grid>

        {/* Toggle switches for HVAC/Sprinkler status */}
        <Grid item xs={12}>
          <Box sx={{ border: '1px solid #e0e0e0', borderRadius: 1, p: 2, mt: 2 }}>
            <Typography variant="subtitle1" gutterBottom>
              Building Systems
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <FormControlLabel
                  control={
                    <Switch
                      checked={formik.values.hasHVAC || false}
                      onChange={formik.handleChange}
                      name="hasHVAC"
                      color="primary"
                    />
                  }
                  label="HVAC System"
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <FormControlLabel
                  control={
                    <Switch
                      checked={formik.values.hasSprinkler || false}
                      onChange={formik.handleChange}
                      name="hasSprinkler"
                      color="primary"
                    />
                  }
                  label="Fire Sprinkler System"
                />
              </Grid>
            </Grid>
          </Box>
        </Grid>

        {/* Additional Physical Attributes Fields could be added here */}
        {/* For example: Year Built, Square Footage, Number of Stories, etc. */}
      </Grid>
    </Paper>
  );
};

export default PhysicalAttributesTab;
